INSERT INTO `ym_bookings` VALUES ('11', '25', 'Taksim Green House Hostel', '0', 'Cumhuriyet caddesi paparoncalli sok No 15 Elmadag/Taksim', '+905324869064', '34437', '12:00', '11:30', '41.042702997683', '28.985420465469', '<p><b>Property Location</b> <br />A stay at Taksim Green House Hostel places you in the heart of Istanbul, convenient to Taksim Gezi Park and Topkapi Palace. This hostel is close to Suleymaniye Mosque and Grand Bazaar.</p><p><b>Rooms</b> <br />Make yourself at home in one of the 9 guestrooms. Prepare your meals in the shared/communal kitchen. Complimentary wireless Internet access is available to keep you connected. Bathrooms have showers and hair dryers.</p><p><b>Rec, Spa, Premium Amenities</b> <br />Make use of convenient amenities such as complimentary wireless Internet access, gift shops/newsstands, and tour/ticket assistance. Getting to nearby attractions is a breeze with the area shuttle (surcharge).</p><p><b>Dining</b> <br />Enjoy a meal at a restaurant or in a coffee shop/café. Or stay in and take advantage of the hostel\'s room service (during limited hours). Quench your thirst with your favorite drink at a bar/lounge.</p><p><b>Business, Other Amenities</b> <br />Featured amenities include a computer station, dry cleaning/laundry services, and a 24-hour front desk. A roundtrip airport shuttle is provided for a surcharge (available on request), and free valet parking is available onsite.</p>', 'Turkey', 'Sisli', '1', 'ciRktvFCCR', '2016-12-16 15:34:03.725010+00:00', '2017-02-16', '2017-02-17', 'Iran', 'IRR', 'Room Only', '382280', 'succeeded', '0', '[{\"ratio\":\"1.00\",\"remainDays\":8}]', '[{\"confirmNumber\":\"276807465|134522400973\",\"name\":[\"masoud gharagozlu\"],\"rooms\":[{\"description\":\" 6-Bed Female Dormitory\",\"type\":\"1\"}]}]', '3380');
INSERT INTO `ym_bookings` VALUES ('12', '26', 'Bilgehan Hotel', '0', 'Adnan Menderes Bulvarı No:1', '+905070731000', '07040', '14:00', '12:00', '36.893274783463', '30.702428519726', '<p><b>Property Location</b> <br />A stay at Bilgehan Hotel places you in the heart of Antalya, minutes from Murat Pasa Mosque and close to Antalya Archeological Museum. This property is within close proximity of Kesik Minaret and Republic Square.</p><p><b>Rooms</b> <br />Make yourself at home in one of the 149 air-conditioned rooms featuring minibars. Rooms have private balconies. Complimentary wireless Internet access keeps you connected, and cable programming is available for your entertainment. Private bathrooms with shower/tub combinations feature complimentary toiletries and hair dryers.</p><p><b>Rec, Spa, Premium Amenities</b> <br />Take in the views from a garden and make use of amenities such as complimentary wireless Internet access and babysitting/childcare (surcharge). Additional amenities include a hair salon, wedding services, and a television in the lobby. Getting to nearby attractions is a breeze with the complimentary area shuttle that operates within 3 km.</p><p><b>Dining</b> <br />Grab a bite from a grocery/convenience store, or stay in and take advantage of the property\'s 24-hour room service.</p><p><b>Business, Other Amenities</b> <br />Featured amenities include complimentary high-speed (wired) Internet access, a 24-hour business center, and a computer station. Planning an event in Antalya? This property has facilities measuring 161 square feet (15 square meters), including a meeting room. A train station pick-up service is provided at no charge at scheduled times, and free valet parking is available onsite.</p>', 'Turkey', 'Antalya', '1', '6UbXKqfbpH', '2017-01-06 10:05:41.653180+00:00', '2017-05-20', '2017-05-21', 'Iran', 'IRR', 'Room Only', '371640', 'succeeded', '0', '[{\"ratio\":\"1.00\",\"remainDays\":2}]', '[{\"confirmNumber\":\"277702526|134917031555\",\"name\":[\"masoud gharagozlu\"],\"rooms\":[{\"description\":\"6 Bed dormitory, City view, Multiple Beds\",\"type\":\"1\"}]}]', '3390');
